Kulmassa on Inkun mielestä laadukkaiden kahvien ja herkullisten kakkujen lisäksi Helsingin paras näkymä suoraan kaupungin sydämeen 😍 Mitä tilaat kahvin kanssa? Kommentoi emojilla "🍰" jos makeaa ja "🥐" jos otat mielummin suolaista purtavaa.

